import {
    Avatar,
    Box,
    Card,
    CardContent,
    Grid,
    Typography
  } from '@material-ui/core';

  const TotalPointsCard = ({totalPoints}) => {
      (totalPoints)&&(console.log(totalPoints.totalPoints))
    return(
        <Card
        sx={{ height: '100%' }}
        >
        <CardContent>
            <Grid
            container
            spacing={3}
            sx={{ justifyContent: 'space-between' }}
            >
            <Grid item>
                <Typography
                color="textSecondary"
                gutterBottom
                variant="h6"
                >
                TOTAL POINTS
                </Typography>
                <Typography
                color="textPrimary"
                variant="h3"
                >
                {totalPoints}
                </Typography>
            </Grid>
            <Grid item>
            </Grid>
            </Grid>
            <Box
            sx={{
                pt: 2,
                display: 'flex',
                alignItems: 'center'
            }}
            >
            </Box>
        </CardContent>
        </Card>
      )}
  
  export default TotalPointsCard;
